syntax = "proto3";

option go_package = "./;proto";

import "MathQuaternion.proto";
import "Vector.proto";

// Name: ECDLKNIAMAF
message ToTheMoonObstacleInfo {
    // Name: PIFLNEEKLJG
    enum ShapeType {
    OBSTACLE_SHAPE_CAPSULE = 0;
    OBSTACLE_SHAPE_BOX     = 1;
    }

    ShapeType type = 11;
    Vector half_extents = 6;
    Vector center = 7;
    int32 handle_id = 5;
    MathQuaternion rotation = 12;
}














